var gen = function(host, url, obj, tests, done) {
    request(host)
    .post(url)
    .send(obj)
    .end(function(err, res) {
        if(err) throw err;
        tests(res.body);
        done();
    });
};

var del = function(obj, done){
    obj.remove(function(err, deleted){
        if (err) throw err;
        done();
    })
};
